const pageLinks=[];

// Funções de decodificação
function atobCustom(input){
    const chars='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=';
    let str=String(input).replace(/=+$/,'');
    if(str.length%4===1) throw new Error('atob failed');
    let output='';
    for(let i=0,n=0,r,c;i<str.length;i++){
        c=chars.indexOf(str.charAt(i));
        if(c===-1) continue;
        n=(n<<6)+c;
        r=(r+1)%4;
        if(r) output+=String.fromCharCode((n>>(8*(3-r)))&255);
    }
    return output;
}

function decodeUtf8(s){
    let bytes=[];
    for(let i=0;i<s.length;i++) bytes.push(s.charCodeAt(i)&255);
    let res='',i=0;
    while(i<bytes.length){
        let b=bytes[i];
        if(b<128){res+=String.fromCharCode(b);i++;}
        else if((b&224)===192 && i+1<bytes.length){
            res+=String.fromCharCode(((b&31)<<6)|(bytes[i+1]&63)); i+=2;
        }else if((b&240)===224 && i+2<bytes.length){
            res+=String.fromCharCode(((b&15)<<12)|((bytes[i+1]&63)<<6)|(bytes[i+2]&63)); i+=3;
        }else if((b&248)===240 && i+3<bytes.length){
            let code=((b&7)<<18)|((bytes[i+1]&63)<<12)|((bytes[i+2]&63)<<6)|(bytes[i+3]&63);
            if(code>65535){
                code-=65536;
                res+=String.fromCharCode((code>>10)+55296,(code&1023)+56320);
            }else res+=String.fromCharCode(code);
            i+=4;
        }else{i++;}
    }
    return res;
}

function step1(s){return s.substring(15,15+18)+s.substring(15+18+17);}
function step2(s){return s.substring(0,s.length-11)+s[s.length-2]+s[s.length-1];}

function decryptLink(enc){
    let e=enc.replace(/Vd__xGEvMo_/g,'g');
    e=e.replace(/b/g,'pw_.g28x').replace(/h/g,'d2pr.x_27');
    e=e.replace(/pw_.g28x/g,'b').replace(/d2pr.x_27/g,'h');
    if(!e.startsWith('https')){
        let q=e.indexOf('?');
        let query=e.substring(q);
        let endIdx=e.includes('=s0?')?e.indexOf('=s0?'):e.indexOf('=s1600?');
        let encPart=e.substring(0,endIdx);
        encPart=step1(encPart);
        encPart=step2(encPart);
        let decoded=decodeUtf8(atobCustom(encPart));
        decoded=decoded.substring(0,13)+decoded.substring(17);
        e='https://2.bp.blogspot.com/'+decoded+query;
    }
    return e;
}

